function [Qsr,Qsc,Qsv,qc] = assmbl_ful_q(iele,nnpe,np,qe,Qsr,Qsc,Qsv,qc)% assembles elemental force and stiffness matrices into global counterpartsnnpe2=2*nnpe;for j=1:1:nnpe            j6=6*np(iele,j);    j5=j6-1;    j4=j5-1;    j3=j4-1;    j2=j3-1;    j1=j2-1;        i6=6*iele;    i5=i6-1;    i4=i5-1;    i3=i4-1;    i2=i3-1;    i1=i2-1;        %       k3=3*j;    %       k2=k3-1;    %       k1=k2-1;        Qsr(qc)=j1;    Qsc(qc)=i1;    %            Qsv(qc)=qe(k1,1);    Qsv(qc)=qe(j,1);    qc=qc+1;    Qsr(qc)=j1;    Qsc(qc)=i2;    %            Qsv(qc)=qe(k1,2);    Qsv(qc)=qe(j,2);    qc=qc+1;    Qsr(qc)=j1;    Qsc(qc)=i3;    %            Qsv(qc)=qe(k1,3);    Qsv(qc)=qe(j,3);    qc=qc+1;    Qsr(qc)=j1;    Qsc(qc)=i4;    %            Qsv(qc)=qe(k1,3);    Qsv(qc)=qe(j,4);    qc=qc+1;    Qsr(qc)=j1;    Qsc(qc)=i5;    %            Qsv(qc)=qe(k1,3);    Qsv(qc)=qe(j,5);    qc=qc+1;    Qsr(qc)=j1;    Qsc(qc)=i6;    %            Qsv(qc)=qe(k1,3);    Qsv(qc)=qe(j,6);    qc=qc+1;                Qsr(qc)=j2;    Qsc(qc)=i1;    %            Qsv(qc)=qe(k2,1);    Qsv(qc)=qe(j+8,1);    qc=qc+1;    Qsr(qc)=j2;    Qsc(qc)=i2;    %            Qsv(qc)=qe(k2,2);    Qsv(qc)=qe(j+8,2);    qc=qc+1;    Qsr(qc)=j2;    Qsc(qc)=i3;    %            Qsv(qc)=qe(k2,3);    Qsv(qc)=qe(j+8,3);    qc=qc+1;    Qsr(qc)=j2;    Qsc(qc)=i4;    %            Qsv(qc)=qe(k2,3);    Qsv(qc)=qe(j+8,4);    qc=qc+1;    Qsr(qc)=j2;    Qsc(qc)=i5;    %            Qsv(qc)=qe(k2,3);    Qsv(qc)=qe(j+8,5);    qc=qc+1;    Qsr(qc)=j2;    Qsc(qc)=i6;    %            Qsv(qc)=qe(k2,3);    Qsv(qc)=qe(j+8,6);    qc=qc+1;            Qsr(qc)=j3;    Qsc(qc)=i1;    %            Qsv(qc)=qe(k3,1);    Qsv(qc)=qe(j+16,1);    qc=qc+1;    Qsr(qc)=j3;    Qsc(qc)=i2;    %            Qsv(qc)=qe(k3,2);    Qsv(qc)=qe(j+16,2);    qc=qc+1;    Qsr(qc)=j3;    Qsc(qc)=i3;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+16,3);    qc=qc+1;    Qsr(qc)=j3;    Qsc(qc)=i4;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+16,4);    qc=qc+1;    Qsr(qc)=j3;    Qsc(qc)=i5;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+16,5);    qc=qc+1;    Qsr(qc)=j3;    Qsc(qc)=i6;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+16,6);    qc=qc+1;            Qsr(qc)=j4;    Qsc(qc)=i1;    %            Qsv(qc)=qe(k3,1);    Qsv(qc)=qe(j+24,1);    qc=qc+1;    Qsr(qc)=j4;    Qsc(qc)=i2;    %            Qsv(qc)=qe(k3,2);    Qsv(qc)=qe(j+24,2);    qc=qc+1;    Qsr(qc)=j4;    Qsc(qc)=i3;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+24,3);    qc=qc+1;    Qsr(qc)=j4;    Qsc(qc)=i4;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+24,4);    qc=qc+1;    Qsr(qc)=j4;    Qsc(qc)=i5;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+24,5);    qc=qc+1;    Qsr(qc)=j4;    Qsc(qc)=i6;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+24,6);    qc=qc+1;        Qsr(qc)=j5;    Qsc(qc)=i1;    %            Qsv(qc)=qe(k3,1);    Qsv(qc)=qe(j+32,1);    qc=qc+1;    Qsr(qc)=j5;    Qsc(qc)=i2;    %            Qsv(qc)=qe(k3,2);    Qsv(qc)=qe(j+32,2);    qc=qc+1;    Qsr(qc)=j5;    Qsc(qc)=i3;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+32,3);    qc=qc+1;    Qsr(qc)=j5;    Qsc(qc)=i4;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+32,4);    qc=qc+1;    Qsr(qc)=j5;    Qsc(qc)=i5;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+32,5);    qc=qc+1;    Qsr(qc)=j5;    Qsc(qc)=i6;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+32,6);    qc=qc+1;            Qsr(qc)=j6;    Qsc(qc)=i1;    %            Qsv(qc)=qe(k3,1);    Qsv(qc)=qe(j+40,1);    qc=qc+1;    Qsr(qc)=j6;    Qsc(qc)=i2;    %            Qsv(qc)=qe(k3,2);    Qsv(qc)=qe(j+40,2);    qc=qc+1;    Qsr(qc)=j6;    Qsc(qc)=i3;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+40,3);    qc=qc+1;    Qsr(qc)=j6;    Qsc(qc)=i4;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+40,4);    qc=qc+1;    Qsr(qc)=j6;    Qsc(qc)=i5;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+40,5);    qc=qc+1;    Qsr(qc)=j6;    Qsc(qc)=i6;    %            Qsv(qc)=qe(k3,3);    Qsv(qc)=qe(j+40,6);    qc=qc+1;    end